import React from 'react';

export default function Input(props){
    return (
        <div>
        <input
            id="input"
            type="text"
            placeholder="country name"
            value={props.value}
            onChange={props.onInputChange}

        />

        <button onClick={props.onSubmit}></button>
        <button onClick={props.onSubmit}></button>
        </div>

    )
}
